import React from 'react';
import ReactDOM  from 'react-dom';
import ''

class ShoppingList extends React.Component{
  render(){
    return(
      <div className="shopping-list">
        <h1>Список покупок для {this.props.name}</h1>
        <ul>
          <li>Instagram</li>
          <li>WhatsApp</li>
          <li>Aculus</li>
        </ul>
      </div>
    );
  }
}
